import 'bootstrap/dist/css/bootstrap.min.css';
import {store} from "./actions/store";
import { Provider } from "react-redux";
import Salesparent from './Salesparent';



function App() {
  return (
   <Provider store={store}>
       <div>
         <Salesparent />
       </div> 
   </Provider>

  );
}

export default App;
